    "2013-03-16T00:20:19.032817",nt"name": "aasg-geothermal-data-fluid-flux-injection-and-disposal-observation-content-model",nt"isopen":
    false,nt"url": null,nt"notes": "The attached spreadsheet contains a content
    model workbook for exchange of information about fluid fluxes into or out of a well.
    A generic model is intended to allow for oil, gas, or water injection (negative
    flow). The focus of this observation type is on injection (any fluid flowed into
    well) or disposal. Because of the wide variety of possible flow measurements (commodities,
    aggregation type), the model adopts a thin approach, which may result in many records
    being returned for a single well. Thus most data about the well is linked through
    the HeaderURI instead of included inline to keep the redundant data volume down.",nt"license_title":
